import "./App.css";
import "./css/bootstrap.css";

import HomePage from "./components/HomePage";
// import Main from "./components/Main";
import Slides from "./components/Slides";
import Main from "./components/Main";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App ">
      <HomePage />
      <div>
      <Slides/>
      <Routes>
        <Route>
          <Slides/>
        </Route>
        <Route path="/home">
          <Main />
        </Route>
      </Routes>
      </div>
    </div>
  );
}

export default App;
